import axios from 'axios'
import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'

import '../propertycard/Propertycard.css'




const Cardele = ({ele,email}) => {
  

  

  return (
    
    <div className='each-card'>
    
    <div className='details-div'>
    <p className='card-title' id='locid'>{ele.location}</p>
    </div >
    <div className='details-div'>
    <p className='card-title' id='priceid'>{ele.price}</p>
    </div>
    <div className='details-div'>
    <p className='card-title'>{ele.Bhk}</p>
    </div>
    <div className='details-div'>
    <p className='card-title'>{ele.bathroom}</p>
    </div>
    <div className='details-div'>
    <p className='card-title'>{ele.sqfeet}</p>
    </div>
    </div>
  )
}


 

const Propertycard = () => {
  const [datas , savedatas] = useState(null);
  const url = 'http://localhost:7000/getProduct'
  axios.get(url,{email:'useremail'}).then((res)=>{
    savedatas(res['data'])
    console.log(res['data'])
  }
  )
  useEffect(()=>{
  },[datas]);
    const cards = datas.map(
        (e)=><Cardele ele={e} key={e.id}/>
    );

  return (
    <div className='cards-div'>
      <div className='cards-container'>{cards}</div>
    </div>
  )
}

export default Propertycard
